', 146, 7, N'7', N'The Flash', N'System.Collections.Generic.List`1[System.String]', N'After a particle accelerator causes a freak storm, CSI Investigator Barry Allen is struck by lightning and falls into a coma. Months later he awakens with the power of super speed, granting him the ability to move through Central City like an unseen guardian angel. Though initially excited by his newfound powers, Barry is shocked to discover he is not the only "meta-human" who was created in the wake of the accelerator explosion -- and not everyone is using their new powers for good. Barry partners with S.T.A.R. Labs and dedicates his life to protect the innocent. For now, only a few close friends and associates know that Barry is literally the fastest man alive, but it won''t be long before the world learns what Barry Allen has become...The Flash.', 1258.983, N'http://image.tmdb.org/t/p/w500/lJA2RCMfsWoskqlQhXPSLFQGXEJ.jpg', N'None', N'None', N'None', N'System.Collections.Generic.List`1[TMDbLib.Objects.Search.SearchTvSeason]', N'None', N'Returning Series', N'None', N'Scripted', N'', 7.7, 7536)
